//import logo from './logo.svg';
import './App.css';

import { useState, useEffect } from 'react'
import { Button, Alert, Card, Container, Row, Col } from 'react-bootstrap'

function App() {

  const [count, setCount] = useState(0)
  const [isEven, setIsEven] = useState(false)

  function doThing() {
    setCount((oldCount) => oldCount + 1)
  }

  useEffect(() => {
    if (count % 2 === 0) {
      setIsEven(true)
    } else {
      setIsEven(false)
    }
  }, [count])

  return (
    <div className="App" style={{width: "100vw", height: "100vh"}}>

      {/* <header className="App-header"> */}
        <Container>
          <Row>
            <Col md>
              <Card>
                <Card.Img />
                <Card.Body>
                  <Card.Title>
                    Eric Website
                  </Card.Title>
                  <Card.Text>
                    yeah you heard that
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
            <Col md>
              <body>
                Words here
              </body>
            </Col>
          </Row>
        </Container>
        <Alert variant="secondary">This button has been pressed {count} times</Alert>
        <Button onClick={doThing}>Test Button 2</Button>
        <body>the number is {isEven ? 'even' : 'not even'}</body>

      {/* </header> */}
    </div>
  );
}

export default App;
